import React from 'react';

class UserImage extends React.Component {
  state = {
    uploading: false,
    images: []
  };

  handleSubmit(event) {
    event.preventDefault();
  }

  render() {
    return (
      <form onSubmit={this.handleSubmit}>
        <input
          id='userImage'
          type='file'
          // onChange={props.onChange}
          ref={this.fileInput}
          hidden
        />
      </form>
    );
  }
}

export default UserImage;
